function dottedLine(doc, xFrom, yFrom, xTo, yTo, segmentLength) {
  // Calculate line length (c)
  var a = Math.abs(xTo - xFrom);
  var b = Math.abs(yTo - yFrom);
  var c = Math.sqrt(Math.pow(a, 2) + Math.pow(b, 2));

  // Make sure we have an odd number of line segments (drawn or blank)
  // to fit it nicely
  var fractions = c / segmentLength;
  var adjustedSegmentLength =
    Math.floor(fractions) % 2 === 0
      ? c / Math.ceil(fractions)
      : c / Math.floor(fractions);

  // Calculate x, y deltas per segment
  var deltaX = adjustedSegmentLength * (a / c);
  var deltaY = adjustedSegmentLength * (b / c);

  var curX = xFrom,
    curY = yFrom;
  while (curX <= xTo && curY <= yTo) {
    doc.line(curX, curY, curX + deltaX, curY + deltaY);
    curX += 2 * deltaX;
    curY += 2 * deltaY;
  }
}
export const downloadPdfEvaluation = async (profile, bmi, img) => {
  const pdf = new jsPDF("portrait", "cm", [21, 29.7]);
  let pageWidth =
    pdf.internal.pageSize.width || pdf.internal.pageSize.getWidth();
  let height = 0;
  pdf.addFileToVFS("BeVietnamPro-Medium-normal.ttf", fontMedium);
  pdf.addFileToVFS("BeVietnamPro-Light-normal.ttf", fontLight);
  pdf.addFileToVFS("BeVietnamPro-LightItalic-normal.ttf", fontLightItalic);
  pdf.addFileToVFS("BeVietnamPro-Bold-normal.ttf", fontBold);
  pdf.addFont(
    "BeVietnamPro-Medium-normal.ttf",
    "BeVietnamPro-Medium",
    "normal"
  );
  pdf.addFont("BeVietnamPro-Light-normal.ttf", "BeVietnamPro-Light", "normal");
  pdf.addFont(
    "BeVietnamPro-LightItalic-normal.ttf",
    "BeVietnamPro-LightItalic",
    "normal"
  );
  pdf.addFont("BeVietnamPro-Bold-normal.ttf", "BeVietnamPro-Bold", "normal");
  pdf.setFont("BeVietnamPro-Light");
  pdf.setFont("BeVietnamPro-Bold");

  pdf.setFont("BeVietnamPro-Bold");
  pdf.setFontSize(20);
  pdf.text("LỊCH SỬ TƯ VẤN", pageWidth / 2, 1, { align: "center" });
  pdf.setFont("BeVietnamPro-Medium");
  pdf.setFontSize(13);
  pdf.text(`Họ và tên: ${profile?.FULLNAME}`, 1, 2);
  pdf.text(`Thành phố: ${profile?.City?.NAME}`, pageWidth - 1, 2, {
    align: "right",
  });
  pdf.text(
    `Ngày sinh: ${moment(profile?.DOB).format(formatDate.Type)}`,
    1,
    2.7
  );
  // pdf.setFont("BeVietnamPro-Bold");
  pdf.setFontSize(10);
  height = 2.7 + 1;

  // height = height + 7

  bmi &&
    bmi.forEach((item) => {
      pdf.setFont("BeVietnamPro-Light");
      pdf.text(`Tuần: ${item?.TUAN}`, 1, height);
      pdf.text(`Chiều cao: ${item?.CHIEUCAO} cm`, 1, height + 0.5);
      pdf.text(`Cân nặng chưa mang thai: ${item?.CANNANG_1} kg`, 5.5, height);
      pdf.text(
        `Cân nặng trong tuần mang thai: ${item?.CANNANG_2} kg`,
        5.5,
        height + 0.5
      );
      pdf.setTextColor(
        item?.CANNANG_TANG > 0
          ? "#00ff00"
          : item?.CANNANG_TANG < 0
          ? "#ff0000"
          : "#000000"
      );
      pdf.text(
        `Cân nặng ${
          item?.CANNANG_TANG > 0
            ? "tăng"
            : item?.CANNANG_TANG < 0
            ? "giảm"
            : "không thay đổi"
        }: ${item?.CANNANG_TANG} kg`,
        15,
        height
      );
      pdf.setTextColor(0, 0, 0);
      pdf.setFont("BeVietnamPro-Medium");
      pdf.text(
        `Kết luận: ${item?.Conclusion_Recommendation?.CONCLUSION}`,
        1,
        height + 1
      );
      height = height + 1;
      pdf.text(
        `Khuyến nghị: ${item?.Conclusion_Recommendation?.RECOMMENDATION}`,
        1,
        height + 0.5
      );

      height = height + 1;
      pdf.setLineWidth(0.01);
      dottedLine(pdf, 1, height, pageWidth - 1, height, 0.1);
      height = height + 1;
    });
  pdf.addPage();
  height = 1;
  pdf.setFont("BeVietnamPro-Bold");
  pdf.setFontSize(20);
  pdf.text("BIỂU ĐỒ TĂNG CÂN", pageWidth / 2, 1, { align: "center" });
  pdf.addImage(img, "PNG", pageWidth / 2 - 9, height + 2, 18, 13);

  pdf.save("lich_su_tu_van.pdf");
};

